import 'bootstrap/dist/css/bootstrap.min.css';
import { BrowserRouter, Routes, Route, Router } from "react-router-dom";
import Hangman from './Hangman';
import { Link } from 'react-router-dom';



function App() {
  return (
    <div>
      <nav>
